import { React } from 'react';
import App from '../App';
import { BrowserRouter as Router, Route } from 'react-router-dom';

const rootRouter = () => (

<Router>
    <div>
        <Route exact path="/" component={App} />
        <Route path="/adminDashboard" component={adminDashboard} />
    </div>
</Router>

)

export default rootRouter;
